  return (
    <Link to={link} className={`tabs ${page === title ? "active_tab" : ""}`}>
      <svg viewBox={viewBox}>
        <path d={pathD} />
      </svg>
      <span>{title}</span>
    </Link>
  );
}
export default function HomeLeft({ page }) {
